def count_even_numbers(n):
    """Write a function that takes an integer n and returns the number of even numbers less than or equal to n.

    Hint: Use the range function to generate a list of numbers from 0 to n, and use the count function to count the number of even numbers.
    """
    return sum([num for num in range(0, n) if num % 2 == 0])
